import React from 'react';
import back from "../images/BACK.webp";

const Header = () => {
    return (
        <>
            <div style={{ overflowY: "hidden" }}>
                {<h1>C</h1>}
                <img 
                    src={back} 
                    alt="Banner" 
                    style={{ 
                        height: "810px", 
                        width: "100%", 
                        objectFit: "cover" 
                    }} 
                /> 
            </div>
        </>
    );
};

export default Header;
